import React, { Component } from 'react'

import NavSections from './navLinks/NavLinks'

import styles from './Navbar.module.css';

export default class Navbar extends Component {

    state = {
        scrolled: false,
        mobile: false,
        myClass: 'toggleButton'
    }

    largeClickHandler = () => {
        this.setState({
            myClass: 'large'
        })
    }

    render() {

        // console.log(window.innerWidth);

        return (
            <div id={styles.navbar}>
                <div id={styles[this.state.myClass]} onClick={this.largeClickHandler}><i class="fas fa-equals"></i></div>
                <img src="https://lexaugustin.github.io/img/logo/logo-bleu.svg"/>
                <div><NavSections/></div>
            </div>
        )
    }
}
